--

CREATE FUNCTION public.calculer_solde_perc(p_account_id integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_solde DECIMAL(15, 2);
BEGIN
    SELECT COALESCE(SUM(montant), 0)
    INTO v_solde
    FROM perc_contributions
    WHERE account_id = p_account_id;
    
    RETURN v_solde;
END;
$$;


